int main() {
    freopen("LOVE.inp", "r", stdin);
    freopen("LOVE.out", "w", stdout);
    long long K;
    int M, N;
    cin >> K >> M >> N;

    vector<int> B(N);
    for (int i = 0; i < N; i++) {
        cin >> B[i];
    }

    set<int> infected(B.begin(), B.end());

    if (K == 1) {

        vector<int> result(B.begin(), B.end());
        sort(result.begin(), result.end());
        for (int x : result) {
            cout << x << " ";
        }
        cout << "\n";
        return 0;
    }

    set<int> prev_day_infected = infected;
    map<set<int>, int> seen_days;
    seen_days[infected] = 1;

    for (int day = 2; day <= K; day++) {
        set<int> new_infected;

        for (int a : prev_day_infected) {
            for (int b : B) {
                int p = (a * b) % M;
                new_infected.insert(p);
            }
        }

        if (new_infected == prev_day_infected) {
            break;
        }

        if (seen_days.count(new_infected)) {

            int first_occurrence = seen_days[new_infected];
            int cycle_length = day - first_occurrence;

            int target_day = (K - first_occurrence) % cycle_length + first_occurrence;

            for (const auto &entry : seen_days) {
                if (entry.second == target_day) {
                    vector<int> result(entry.first.begin(), entry.first.end());
                    sort(result.begin(), result.end());
                    for (int x : result) {
                        cout << x << " ";
                    }
                    cout << "\n";
                    return 0;
                }
            }
        }

        prev_day_infected = new_infected;
        seen_days[new_infected] = day;
    }

    vector<int> result(prev_day_infected.begin(), prev_day_infected.end());
    sort(result.begin(), result.end());
    for (int x : result) {
        cout << x << " ";
    }
    cout << "\n";
}
